ON CONFLICT (id) DO UPDATE SET
  make             = EXCLUDED.make,
  model            = EXCLUDED.model,
  price_min_paise  = EXCLUDED.price_min_paise,
  price_max_paise  = EXCLUDED.price_max_paise,
  updated_at       = NOW();
